import React, { useState } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import CreateEditResume from './components/CreateEditResume';
import ViewResume from './components/ViewResume';

const App = () => {
  return (
    <Router>
      <div>
        <h1>Resume Builder</h1>
        <nav>
          <ul>
            <li>
              <Link to="/">Create/Edit Resume</Link>
            </li>
            <li>
              <Link to="/view">View Resume</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route exact path="/" component={CreateEditResume} />
          <Route path="/view" component={ViewResume} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
